import React, { useState } from "react";
import { LockOutlined, UserOutlined } from '@ant-design/icons';
import { Button, Card, Checkbox, Form, Input } from 'antd';
import 'antd/dist/antd.css';


const Signup = () => {

    const onFinish = (values) => {
        console.log('Received values of form: ', values);
      };

return(
    <Card style={{width: '60%', margin: 'auto', marginTop: '300px'}}>
    <Form
    name="normal_login"
    className="login-form"
    initialValues={{
      remember: true,
    }}
    onFinish={onFinish}
    style={{width: '50%', textAlign : 'center', margin: 'auto'}}
  >
    <Form.Item
      name="username"
    >
      <Input prefix={<UserOutlined className="site-form-item-icon" />} placeholder="Username" />
    </Form.Item>
    <Form.Item
      name="password"
    >
      <Input
        prefix={<LockOutlined className="site-form-item-icon" />}
        type="text"
        placeholder="Password"
      />
    </Form.Item>

    <Form.Item
      name="password"
    >
      <Input
        prefix={<LockOutlined className="site-form-item-icon" />}
        type="text"
        placeholder="Check Password"
      />
    </Form.Item>

    <Form.Item>
      <Button style={{backgroundColor: 'black', color: 'white'}} htmlType="submit" className="login-form-button">
        로그인
      </Button>
      Or <a href="" style={{color: 'black'}}>회원가입 하러 가기</a>
    </Form.Item>
  </Form>
  </Card>
);
};

export default Signup;
